import React from 'react';
import './App.css';
import Form from './Form';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import FormSignIn from './FormSignIn';


function App() {
  return (

    <div className="App">

     <Router>

     <Switch>
       <Route exact path = "/">
         <Switch>
         <span className="form-input-login"/>
         </Switch>
       </Route>

       <Route path = "/container">
         <Switch>
           <FormSignIn/>
         </Switch>
       </Route>

     </Switch>
    </Router>

    </div>
  );
}

export default App;
